import { TestBed } from '@angular/core/testing';
import { VotingScreenComponent } from './ballot-box.component';
describe('VotingScreenComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        await TestBed.configureTestingModule({
            declarations: [VotingScreenComponent]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(VotingScreenComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
    it('should change voting step to 3', () => {
        component.onUserVoted();
        expect(component.voting_step).toBe(3);
    });
});
